import React from "react";

function Navbar() {
    return(
        <div className="navbar">
        <div className="site-name">
            <h1>TrackDonations</h1>
        </div>
        <div className="tabs">
            <ul>
                <li>Campaigns</li>
                <li>Vote</li>
                <li>Track</li>
            </ul>
        </div>
        </div>
    )
}
export default Navbar;
